import Head from "next/head";

const About = () => {
  return (
    <div>
      <Head>
        <title>OJOS | About</title>
        <link rel="icon" href="/favicon.ico" />
      </Head>
      <h1 className="page-title">About</h1>
    </div>
  );
};

export default About;
